import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.png';

function Home(){
  return (
    <section id="intro">
              <img src={imgme} alt="Me" className="photoofme" />
      <span className="rectbox"></span>
    </section>
  )
}

export default Home;
